// client/src/components/AccountInfo.js
import React from 'react';

const AccountInfo = ({ user }) => {
  return (
    <div className="account-info">
      <p>Welcome, {user.name}</p>
      {/* Add additional account information as needed */}
    </div>
  );
};

export default AccountInfo;
